// import { Box, } from '@mui/material'
import "./App.css";
import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";

function SignUp() {
  const [firstusername, setNamef] = useState("");
  const [lastusername, setNamel] = useState("");
  const [password, setPassword] = useState("");
  const [authpass, setAuthpass] = useState("");
  const [email, setEmail] = useState("");
  const navigate = useNavigate();

  const handleMenuClick = (path) => {
    navigate(path);
  };

  useEffect(() => {
    if (localStorage.getItem("user-info")) {
    }
  });

  {
    const data = { firstusername, lastusername, password, email };
    console.log(data);
  }



  return (
    <div className="flex-container">
      <div className="signup-nav">
        {/* <h1>pulse</h1> */}
      </div>
      <div className="details-login">
        <form className="flex-login">
          <div className="pulse">
            <h1 data-text="WELCOME TO PULSE "> WELCOME TO PULSE </h1>
          </div>
          <div className="user-container">
            <div className="user">
              <input
                type="text"
                placeholder="first_name"
                value={firstusername}
                onChange={(e) => setNamef(e.target.value)}
              />
            </div>
            <div className="user">
              {" "}
              <input
                type="text"
                placeholder="last_name"
                value={lastusername}
                onChange={(e) => setNamel(e.target.value)}
              />
            </div>
            <div className="user">
              <input
                type="password"
                placeholder="password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
              />
            </div>
            <div className="user">
              <input
                type="password"
                placeholder="confirm password"
                value={authpass}
                onChange={(e) => setAuthpass(e.target.value)}
              />
            </div>
            <div className="user">
              <input
                type="text"
                placeholder="email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
              />
            </div>
          </div>
          <div className="signup-btn">
          <button
              className="signup-btn1"
              onClick={() => handleMenuClick("/homes")}
            >
              Sign Up
            </button>
          </div>
          <div className="signup-btn">
          <div className="login-signin-container">
            <p>Already have an account? </p>
          <div className="signup-btn2" onClick={() => handleMenuClick("/login")}>
            Login
          </div>
          </div>
          </div>
        </form>
      </div>
    </div>
  );
}

export default SignUp;
